import React from "react";
import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div>
      <AppTitle />
      <Raiting />
      <Accordion />
      <Raiting />
    </div>
  );
};
export default App;

export function AppTitle() {
  return <>"This is app component"</>;
}

export const Raiting = () => {
  return (
    <>
      <Start />
    </>
  );
};

export const Start = () => {
  return (
    <>
      <div>start</div>
      <div>start1</div>
      <div>start2</div>
    </>
  );
};

export const Accordion = () => {
  return (
    <div>
      <AccordionTitle />
      <AccordionBody />
    </div>
  );
};
export const AccordionTitle = () => {
  return (
    <div>
      <h3>menu</h3>
    </div>
  );
};
export const AccordionBody = () => {
  return (
    <div>
      <ul>
        <li>1</li>
        <li>2</li>
        <li>3</li>
      </ul>
    </div>
  );
};
